INSERT INTO public.localized VALUES ('f5ddd600-e008-40a4-a35e-ddafc5a7043e', 'sunday feels', 'Song is called sunday feels by TIM but I uploaded it on a friday ğŸ˜[NL]https://soundcloud.com/itsokdontbesad[NL]ğŸ¬ Movie: Blue Summer[NL][NL]I don''t upload often but I''m doing ok. I''m sorry for not responding your direct messages. I''m grateful and appreciate your kind words but I don''t know how to respond to them. [NL][NL]I think I might be not ok in the head because I don''t sync video like almost everyone, it''s kinda like editing with my feelings, how I feel about each part of a song.[NL][NL]There may be more people read description if I disable comments, I guess. But people should be allowed to express their thoughts and feelings, so I enable comments again.[NL][NL]In 2021, this video was meant to be my last video before I take an indefinite break from this channel. When I''m not editing a video, I still spend time thinking about this channel, I often come back to my songs list and decide which song and which anime to edit and it''s very time consuming. But I didn''t publish this video in 2021. [NL][NL]Does my editing matter? Do you really need to see something going with the music? Can I just upload the music for you to listen if you''re interested? You can go to my youtube playlists and find what I''m listening but it''s still a little different from what I store in my hdd.[NL][NL]Sometimes I want to edit love songs, sometimes cute/wholesome, sometimes more mature theme, sometimes dark theme... I think less people listen to sad vibe now compared to 2019. It''s a good news, let''s be happy. I like reminiscing the past, especially when I was a student in high school and in university, when I first loved someone. That''s why I watch anime/movies about students'' life.  [NL][NL]My channel is dead, which is a good thing. It feels like when I first started this channel, 1-2k views, a few comments, no pressure on uploading. Now it feels even more like a personal space. [NL][NL]I type like english subtitles of a kpop idol on livestream. I mean my sentences seem like they''re from a translator app. But they''re not.[NL][NL]ğŸ‘‰ Follow sunset boy[NL]https://linktr.ee/realsunsetboy[NL]https://soundcloud.com/thesunsetboy[NL]https://www.instagram.com/realsunsetboy/[NL]https://twitter.com/_thesunsetboy', '2025-03-14 15:52:36.782+00', '2025-03-14 15:52:36.782+00');
